import React, { useEffect, useState } from 'react';
import { 
  BarChart, 
  Bar, 
  XAxis, 
  YAxis, 
  CartesianGrid, 
  Tooltip, 
  Legend, 
  PieChart, 
  Pie, 
  Cell, 
  LineChart, 
  Line 
} from 'recharts';
import { 
  Grid, 
  Paper, 
  Typography, 
  CircularProgress,
  Box 
} from '@mui/material';

const CHART_COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042', '#8884d8'];

const TaskAnalytics = ({ username }) => {
  const [analyticsData, setAnalyticsData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const API_BASE_URL = 'http://localhost:5000/api';

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`${API_BASE_URL}/users/${username}/task-analytics`);
        if (!response.ok) throw new Error(`HTTP error! status: ${response.status}`);
        const data = await response.json();

        setAnalyticsData(data);
        setError(null);
      } catch (error) {
        console.error('Fetch error:', error);
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [username]);

  const processedData = analyticsData
    ? analyticsData.map(item => ({
        ...item,
        total_time: Number(item.total_time), // Convert to number
      }))
    : [];


  if (loading) {
    return (
      <Box display="flex" justifyContent="center" mt={4}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box mt={4} p={2} bgcolor="error.light" color="error.contrastText">
        <Typography variant="body1">Error loading analytics: {error}</Typography>
      </Box>
    );
  }
  console.log(processedData)
  if (!processedData) {
    return (
      <Box mt={4}>
        <Typography variant="body1">No analytics data available</Typography>
      </Box>
    );
  }
  return (
    <Grid container spacing={3} sx={{ mt: 2 }}>
      {/* First Box */}
      <Grid item xs={12} md={6}>
        <Paper sx={{ p: 2, height: 400 }}>
          <Typography variant="h6">
            Total Processing Time by Area (Minutes)
          </Typography>
          <Box sx={{ height: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
            {processedData && processedData.length > 0 ? (
              <BarChart
                width={750} // Adjust graph width
                height={600} // Adjust graph height
                data={processedData}
                margin={{ top: 5, right: 30, left: 20, bottom: 5 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="area_name" label={{ value: 'Task Area', position: 'bottom', fontSize: '24px', fontFamily: 'Arial' }} tick={{ fontSize: '20x', fontFamily: 'Arial' }} />
                <YAxis domain={[0, 'auto']} label={{ value: 'Minutes', angle: -90, position: 'left', fontSize: '24px', fontFamily: 'Arial' }} tick={{ fontSize: '20px', fontFamily: 'Arial' }} />
                <Tooltip formatter={(value) => [`${value}s`, 'Total Time']} />
                <Bar dataKey="total_time" name="Total Time" fill="#8884d8" />
              </BarChart>
            ) : (
              <Typography variant="body2">No processing time data available</Typography>
            )}
          </Box>
        </Paper>
      </Grid>

      {/* Second Box */}
      <Grid item xs={12} md={6}>
        <Paper sx={{ p: 2, height: 400 }}>
          <Typography variant="h6" gutterBottom>
            Second Graph Title
          </Typography>
          <Box sx={{ height: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
            {/* Replace with actual graph */}
            <Typography variant="body2">Graph Placeholder</Typography>
          </Box>
        </Paper>
      </Grid>

      {/* Third Box */}
      <Grid item xs={12} md={6}>
        <Paper sx={{ p: 2, height: 400 }}>
          <Typography variant="h6" gutterBottom>
            Third Graph Title
          </Typography>
          <Box sx={{ height: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
            {/* Replace with actual graph */}
            <Typography variant="body2">Graph Placeholder</Typography>
          </Box>
        </Paper>
      </Grid>

      {/* Fourth Box */}
      <Grid item xs={12} md={6}>
        <Paper sx={{ p: 2, height: 400 }}>
          <Typography variant="h6" gutterBottom>
            Fourth Graph Title
          </Typography>
          <Box sx={{ height: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
            {/* Replace with actual graph */}
            <Typography variant="body2">Graph Placeholder</Typography>
          </Box>
        </Paper>
      </Grid>
    </Grid>
  ); 
};

export default TaskAnalytics;
